script: |
  super -f text -I q6333.spq | sort > q6333.out

inputs:
  - name: q6333.spq
    data: |
      SELECT DISTINCT - col2 * col2 AS col1 FROM tab0 (FORMAT parquet) WHERE - 58 / - col2 - - col2 NOT BETWEEN NULL AND 86 * - 31;
  - name: tab0

outputs:
  - name: q6333.out
    data: |
      -100
      -2209
      -9801
